import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './Menu.css';

const Menu = ({ loggedIn, handleLogout }) => {
  const navigate = useNavigate();

  const handleLogoutClick = () => {
    handleLogout();
    navigate('/login');
  };

  return (
    <div className="menu">
      <ul className="menu-links">
        {loggedIn && (
          <>
            <li className="menu-link"><Link to="/">Home</Link></li>
            <li className="menu-link"><Link to="/calendar">Calendar</Link></li>
            <li><button className="menu-link" onClick={handleLogoutClick}>Logout</button></li>
          </>
        )}
      </ul>
    </div>
  );
};

export default Menu;
